import React from 'react';
import ReactDOM from 'react-dom';
import DisplayCards from './DisplayCards.js'
import './app.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          SpaceX
        </h1>
      </header>
      <DisplayCards />
    </div>
  );
}

export default App;
